import './master.css';
import React from 'react';

const InputField = (props) => {
  return (
    <div className="form-group">
      <input type={props.type} className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder={props.title} />
    </div>
  );
};

export default InputField;
